["tip_wt"] = New("tip_wt","工作时间：球员只会在工作时间内工作，工作时间结束后进入休息时间","Working Hours: Players only working during their working hours. After their working hours end, they will take a break.","勤務時間：スタッフの作業は勤務時間中にのみ発生します。勤務時間が終わったら休憩時間に入ります。","工作時間：球員只會在工作時間內工作，工作時間結束後進入休息時間","Arbeitszeiten: Die Spieler arbeiten nur während ihrer Arbeitszeiten. Nach dem Ende ihrer Arbeitszeit machen sie eine Pause.","Рабочее время: Игроки работают только в рабочее время. После окончания рабочего времени они делают перерыв.","Heures de travail : Les joueurs ne travaillent que pendant leurs heures de travail. Une fois leurs heures de travail terminées, ils prennent une pause.","Orario di lavoro: I giocatori lavorano solo durante il loro orario di lavoro. Dopo la fine del loro orario di lavoro, faranno una pausa.","Horario de trabajo: Los jugadores sólo trabajan durante su horario de trabajo. Una vez finalizado su horario de trabajo, se tomarán un descanso.","Horas de trabalho: Jogadores a trabalhar apenas durante o seu horário de trabalho. Após o fim do seu horário de trabalho, farão uma pausa.",""),
["tip_rt"] = New("tip_rt","休息时间：球员在休息时间内不会工作，休息时间结束后进入工作时间","Break Time: Players do not work during their break time. After their break time ends, they will start working.","休憩時間：休憩時間にいるスタッフが作業しません。休憩時間が終わったら勤務時間に切り替えます。","休息時間：球員在休息時間內不會工作，休息時間結束後進入工作時間","Pausenzeit: Die Spieler arbeiten nicht während ihrer Pausenzeit. Nach dem Ende ihrer Pausenzeit beginnen sie mit der Arbeit.","Время перерыва: Игроки не работают во время перерыва. После окончания перерыва они начинают работать.","Temps de pause : Les joueurs ne travaillent pas pendant leur temps de pause. Après la fin de leur temps de pause, ils commenceront à travailler.","Tempo di pausa: I giocatori non lavorano durante il loro tempo di pausa. Dopo che il loro tempo di pausa finisce, inizieranno a lavorare.","Tiempo de descanso: Los jugadores no trabajan durante su tiempo de descanso. Después de que termine su tiempo de descanso, empezarán a trabajar.","Tempo de pausa: Os jogadores não trabalham durante o seu tempo de pausa. Após o fim do seu tempo de pausa, começarão a trabalhar.",""),
