["tip_maincash"] = New("tip_maincash","<size=26><color=#aa5f9b>钞票</color></size>通用货币，可用于升级设备和课程，球员训练，棒球场比赛等。主线任务挂机，完成任务等可获取大量钞票。","<size=26><color=#aa5f9b>Cash</color></size> is mainly used for upgrading facilities and courses， training players， and participating in games. You may earn more cash by completing main quests or idling.","<size=26><color=#aa5f9b>お札</color></size>が基本通貨。設備とコースのlvアップに使えます。選手練習、試合などで普通にもらえていて、クエストの達成や放置によって大量に獲得できます。","<size=26><color=#aa5f9b>鈔票</color></size>通用貨幣，可用於升級設備和課程，球員訓練，棒球場比賽等。主線任務挂機，完成任務等可獲取大量鈔票。","<size=26><color=#aa5f9b>Bargeld</color></size> wird hauptsächlich für die Verbesserung von Einrichtungen und Kursen, das Training von Spielern und die Teilnahme an Spielen verwendet. Du kannst mehr Geld verdienen, indem du Hauptquests erledigst oder im Leerlauf spielst.","<size=26><color=#aa5f9b>Деньги</color></size> в основном используются для модернизации объектов и курсов, обучения игроков и участия в играх. Вы можете заработать больше денег, выполняя основные задания или бездельничая.","<size=26><color=#aa5f9b>Cash</color></size> est principalement utilisé pour améliorer les installations et les cours， entraîner les joueurs， et participer aux matchs. Vous pouvez gagner plus d\'argent en accomplissant des quêtes principales ou en tournant au ralenti.","<size=26><color=#aa5f9b>Il denaro</color></size> è usato principalmente per migliorare le strutture e i corsi, allenare i giocatori e partecipare alle partite. Puoi guadagnare più contanti completando le missioni principali o oziando.","<size=26><color=#aa5f9b>El dinero en efectivo</color></size> se utiliza principalmente para mejorar las instalaciones y los campos, entrenar a los jugadores y participar en los partidos. Puedes ganar más dinero en efectivo completando misiones principales o haciendo el vacío.","<size=26><<color=#aa5f9b>Cash</color></tamanho> é utilizado principalmente para melhorar as instalações e courses， treino players， e participação em jogos. Pode ganhar mais dinheiro completando as principais missões ou ociosidade.",""),
